    return (

        <div className='text-bg-dark text-white footer width: 50% d-flex justify-content-around'>
        <h3>Find:</h3>
        <a href="https://www.instagram.com/cms.corp">
        <img style={{width:'80px', borderRadius:'30px'}} src={icon} />
        {/* <button >Check Us Out on Instagram</button> */}
        </a>
        <a href="https://www.yelp.com/biz/castro-mobile-services-new-york#reviews">
        <img style={{width:'80px', borderRadius:'40px'}} src={yelp} />
        </a>
        </div>
    );
}

export default Footer;
